    false,nt"url": null,nt"notes": "Excess soil sediment has been described
    as the greatest single contaminant by volume of lakes, streams and rivers. Sediment
    containing organic matter can create a biochemical oxygen demand in natural waters
    that damages the habitat of fish and other aquatic life, reduce recreational values,
    and adversely affect water supplies. It can also clog stream channels, contributing
    to increased stream bank and channel erosion. This report offers the best management
    practices of preventing soil erosion as a result of logging.",nt"license_title":
